        "about": MessageLookupByLibrary.simpleMessage("About"),
        "aboutContent": MessageLookupByLibrary.simpleMessage(
            "We want you to know that behind Armor of God, there is a group of brothers by faith in Christ, who seek to glorify the Author of our Salvation through the natural gifts and professions that He has granted us in His Grace. We are committed to the help from the Lord to continue improving and creating content aligning ourselves to His will.\n\nWe sincerely appreciate your support and trust in the Armor of God project. We hope you enjoy the app and find it uplifting!\n\nHave fun and keep unlocking knowledge!\n\nSincerely,\n\nThe Armor of God Development Team"),
        "accept": MessageLookupByLibrary.simpleMessage("Accept"),
        "answerAllQuestions": MessageLookupByLibrary.simpleMessage(
            "To submit, answer all questions"),
        "armor1": MessageLookupByLibrary.simpleMessage("Belt of Truth"),
        "armor1Text1": MessageLookupByLibrary.simpleMessage(
            "The first piece of the armor of God; it is the belt of truth. As we know, the belt of an armor is meant to support, fasten or keep the entire armor together, it is the center piece on the body that holds everything. In the same way, this piece typifies Christ himself, Jesus Christ is the truth, Jesus said in John 14:6 I AM the Way, and the "),
        "armor1Text2": MessageLookupByLibrary.simpleMessage("truth "),
        "armor1Text3": MessageLookupByLibrary.simpleMessage(
            "and life, He is the Word, that is to say, the incarnate Word John 1:1, without this reality as a foundation, everything we do will not be sustained, just as an armor without a belt is not sustained, our actions must be in accordance with the truth of the Scriptures, aligned with Christ, we must support each thought with the truth of the Bible; we must hold the words of our mouth with the veracity of the truth, in the light of the Gospel. Since, again quoting the words of the Lord in Matthew: 7:24-27 where he says: "),
        "armor1Text4": MessageLookupByLibrary.simpleMessage(
            "Anyone, then, who hears these words from me, and does them, I will compare him to a prudent man, who built his house on the rock. The rain came down, and the rivers came, and the winds blew and beat against that house; and it did not fall, because it was founded on the rock. But whoever hears these words from me and does not do them, I will compare him to a foolish man, who built his house on the sand; and the rain came down, and the rivers came, and the winds blew, and beat against that house; and he fell, and his ruin was great. "),
        "armor1Text5": MessageLookupByLibrary.simpleMessage(
            "If we keep this in mind, we will maintain the truth in everything that is done, this will be the central axis of our Christian life.\n\nThe position and shape of this piece speaks of Christ, as the belt is located in the middle of the armor, in the same way Christ must be in the center of us and of everything, because everything was created through him and for him. him, let us note that when Christ was crucified, he was in the middle of two thieves, which indicates that the extremes are thieves, the center is Christ. As for the form, it surrounds the person, likewise the truth must surround all areas of our life, not leave out of the truth anything we do, the Lord surrounds our entire being, as the psalmist says: "),
        "armor1Text6": MessageLookupByLibrary.simpleMessage(
            "“You surrounded me behind and before, and laid your hand on me.” Psalm 139:5. "),
        "armor1TextBible1": MessageLookupByLibrary.simpleMessage(
            "All the Word is true, it is inspired by God, let\'s take for example what Proverbs says: 16:18 "),
        "armor1TextBible1_2": MessageLookupByLibrary.simpleMessage(
            "“Before brokenness is pride; and before the fall the haughty spirit”, "),
        "armor1TextBible1_3": MessageLookupByLibrary.simpleMessage(
            "we see this reflected in the book of Daniel with King Nebuchadnezzar, says "),
        "armor1TextBible2": MessageLookupByLibrary.simpleMessage(
            "Daniel 4:28-33\n28 All this came upon King Nebuchadnezzar. 29 At the end of twelve months, walking in the royal palace of Babylon, 30 the king spoke and said: Is not this the great Babylon that I built for a royal house with the strength of my power, and for the glory of my majesty? 31 The word was still in the king\'s mouth, when a voice came from heaven: It is said to you, king Nebuchadnezzar: The kingdom has been taken away from you; 32 And from among men they will drive you out, and with the beasts of the field your dwelling will be, and they will feed you like oxen; and seven times will pass over you, until you recognize that the Most High has dominion in the kingdom of men, and gives it to whomever he wants. 33 In the same hour the word about Nebuchadnezzar was fulfilled, and he was thrown out from among men; and he ate grass like oxen, and his body was wet with the dew of heaven, until his hair grew like eagle\'s feathers, and his nails like those of birds."),
        "armor1TextBible3":
            MessageLookupByLibrary.simpleMessage("Daniel 4:28-33 "),
        "armor1TextBible4": MessageLookupByLibrary.simpleMessage(
            "Nebuchadnezzar\'s pride caused him to live like a beast for seven years, that is, the fall proceeded from haughtiness."),
        "armor1TextLife1": MessageLookupByLibrary.simpleMessage(
            "As believers, we must dwell every day in the Word of our Lord, it is the only way to adhere to the truth, if we are in search of the truth, then we must read the Scriptures and fill our minds with them."),
        "armor1TextPractice1": MessageLookupByLibrary.simpleMessage(
            "A doctor needs the truth of the symptoms told by the patient to reach the correct diagnosis. Another example is when the enemy tries to accuse us with the past, then let\'s remember what 2 Corinthians 5:17 says. "),
        "armor1TextPractice2": MessageLookupByLibrary.simpleMessage(
            "So if anyone is in Christ, he is a new creature; old things passed away; behold, they are all made new. "),
        "armor1TextPractice3": MessageLookupByLibrary.simpleMessage(
            "We must hold fast to the truth that is Christ in everything we do to wear this piece of God\'s armor."),
        "armor1Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:14"),
        "armor1Verse": MessageLookupByLibrary.simpleMessage(
            "“Stand firm then, having your loins girded about with truth,”"),
        "armor2": MessageLookupByLibrary.simpleMessage(
            "The Breastplate of Righteousness"),
        "armor2Text1": MessageLookupByLibrary.simpleMessage(
            "The armor is the piece of armor that covers the torso, where the vital organs are located, this is very important, since a wound to one of these organs can be fatal. Christ is righteousness Isaiah 59:17a "),
        "armor2Text10": MessageLookupByLibrary.simpleMessage(
            "so we will be protected by the breastplate of justice, the king and psalmist David said: "),
        "armor2Text11": MessageLookupByLibrary.simpleMessage(
            "Trust in the Lord, and do good; And you will dwell on the earth, and you will feed on the truth. 4 Delight yourself also in the Lord, and he will give you the desires of your heart. 5 Commit your way to the Lord, and trust in him; and he will. 6 He will display your righteousness like light, And your justice like noon. 7 Keep silent before Jehovah, and wait on him. Do not be upset because of the one who prospers in his way, For the man who does evil. Psalm 37:4-7. "),
        "armor2Text12": MessageLookupByLibrary.simpleMessage(
            "Let\'s take note that when you are attacked you do not have to do anything, it is not like the shield of faith where you must take an action to cover yourself, but if we were in the other scenario where it is up to us to make the judgment, we must do it, because if we don\'t we do we would not be working the justice of God. The breastplate, like all armor, we must take it before going into battle, which means that we have to act righteously at all times and not occasionally. Justice is part of sanctification, that is, of advancing to the stature of Christ."),
        "armor2Text2": MessageLookupByLibrary.simpleMessage(
            "“Justice was put on as a breastplate”. "),
        "armor2Text3": MessageLookupByLibrary.simpleMessage(
            "We must understand that it is not our righteousness, but the righteousness of Christ that works through us. As believers we must seek and do justice as Jesus tells us in Matthew 6:33 and in Micah 6:8 "),
        "armor2Text4": MessageLookupByLibrary.simpleMessage(
            "“But seek first the kingdom of God and his righteousness, and all these things will be added to you.”, “8 O man, he has declared to you what is good, and what does Jehovah require of you: only to do justice, and to love mercy, and to humble yourself before your God.” "),
        "armor2Text5": MessageLookupByLibrary.simpleMessage(
            "What is meant by this is to seek and execute righteousness, according to the Scriptures in every circumstance, Proverbs 11:6 "),
        "armor2Text5_1": MessageLookupByLibrary.simpleMessage(
            "“The justice of the upright will deliver them; but sinners will be caught in their sin”. "),
        "armor2Text5_2": MessageLookupByLibrary.simpleMessage(
            "If we walk according to the laws of the Lord, the day we encounter a problem, trial or difficulty, we will be protected by His justice according to His purpose, our vital organs will be protected, the vital organs can be life itself, family, resources.\n\nTo put on this piece of God\'s armor we need to always act righteously, and this is even to remain silent when it is not up to us to exercise judgment, because the Lord established judges who must exercise justice, justice has a active part - passive, active in which we must look for it, that is, act justly in any situation Deuteronomy 1:16 "),
        "armor2Text6": MessageLookupByLibrary.simpleMessage(
            "“By holding audience among their brothers, they have to judge justly.” "),
        "armor2Text7": MessageLookupByLibrary.simpleMessage(
            "and passive in that we must wait for the time of the judgment and the person who exercises it, see "),
        "armor2Text8": MessageLookupByLibrary.simpleMessage(
            "Deuteronomy 25:1\n25 If there be a lawsuit between some, and they go to court so that the judges judge them, they will acquit the just, and condemn the guilty.\n\n1 Corinthians 6:4-5\n4 If, then, you have judgments about things of this life, do you judge those who are of lesser esteem in the church? 5 To shame you I say it. What then, is there not a wise man among you, not even one, who can judge between his brothers,"),
        "armor2Text9": MessageLookupByLibrary.simpleMessage(
            "Deuteronomy 25:1, 1 Corinthians 6:4-5, "),
        "armor2TextBible1": MessageLookupByLibrary.simpleMessage(
            "The Bible, which is the word of God, is true, and tells us the facts as they are for our example, an example that when we are not judged with the justice of God we are not protected, is King David before the acts of his son Amnon. His family was very affected by very strong events see "),
        "armor2TextBible2": MessageLookupByLibrary.simpleMessage(
            "2 Samuel 13\n13 After this, Absalom son of David having a beautiful sister named Tamar, Amnon son of David fell in love with her. 2 And Amnon was distressed to the point of falling ill for Tamar his sister, for because she was a virgin, it seemed to Amnon that it would be difficult to do anything to her. 3 And Amnon had a friend named Jonadab, the son of Simea, David\'s brother; and Jonadab was a very cunning man. 4 And he said to him: Son of the king, why do you grow thinner like this from day to day? Won\'t you find out for me? And Amnon answered him: I love Tamar the sister of Absalom my brother. 5 And Jonadab said to him: Lie down on your bed, and pretend that you are sick; and when your father comes to visit you, say to him: I beg you that my sister Tamar come, that she may give me something to eat, and prepare before me some food, so that when I see her I may eat it from her hand. 6 So Amnon lay down, and pretended that he was ill; and the king came to visit him. And Amnon said to the king, I beg you, let my sister Tamar come and make two flakes before me, that I may eat from her hand. 7 And David sent Tamar to her house, saying, Go now to Amnon\'s house your brother, and make him eat. 8 And Tamar went to the house of her brother Amnon, who was lying down; and he took flour, and kneaded it, and made flakes before him, and baked them. 9 Then he took the frying pan, and brought them out before him; but he did not want to eat. And Amnon said: Cast everyone out of here. And they all got out of there. 10 Then Amnon said to Tamar: Bring the food to the bedroom, so that I may eat from your hand. And taking Tamar the flakes that she had prepared, she took them to her brother Amnon in the bedroom. 11 And when she put them before him to eat, he took hold of her, and said to her, Come, my sister, lie down with me. 12 She then answered him: No, my brother, do not do violence to me; because it should not be done like that in Israel. Don\'t do such a wicked thing. 13 For where would I go with my dishonor? And even you would be esteemed as one of the wicked in Israel. I beg you, then, now, that you speak to the king, that he will not deny me to you. 14 But he did not want to listen to her, but being able more than her, he forced her, and lay with her."),
        "armor2TextBible3":
            MessageLookupByLibrary.simpleMessage("2 Samuel 13, "),
        "armor2TextBible4": MessageLookupByLibrary.simpleMessage(
            "We have the opposite case with Moses when he came down from being in the presence of the Lord on the mountain and the people had built an idol, Moses exercised the judgment of God and brought as a consequence to know those who had a willing heart for the Lord to see "),
        "armor2TextBible5": MessageLookupByLibrary.simpleMessage(
            "Exodus 32\nWhen the people saw that Moses was taking a long time to come down from the mountain, they came to Aaron and said, Get up, make us gods to go before us. We do not know what happened to this Moses, the man who brought us out of the land of Egypt. 2 And Aaron said to them, Break off the golden earrings that are in the ears of your wives, your sons, and your daughters, and bring them to me. 3 Then all the people parted the golden earrings that were in their ears, and brought them to Aaron; 4 and he took them from their hands, and shaped it with a burin, and made a molten calf of it. Then they said: Israel, these are your gods, which brought you out of the land of Egypt. 5 And when Aaron saw this, he built an altar before the calf; and Aaron proclaimed, and said, Tomorrow shall be a feast to Jehovah. 6 And they rose early the next day, and offered holocausts, and presented peace offerings; and the people sat down to eat and drink, and rose up to play. 7 Then the LORD said to Moses, Go, go down, for your people whom you brought out of the land of Egypt have corrupted themselves. 8 They have soon turned aside from the path which I commanded them; They have made for themselves a molten calf, and have worshiped it, and have offered sacrifices to it, and have said, Israel, these are your gods, which brought you out of the land of Egypt. 9 Jehovah said more to Moisés: I have seen this town, that by the way is town of stubborn neck. 10 Now therefore let my wrath burn upon them, and consume them; and of you I will make a great nation. 11 Then Moses prayed in the presence of the LORD his God, and said, O LORD, why shall your anger be kindled against your people, whom you brought out of the land of Egypt with great power and with strong hand? 12 Why should the Egyptians speak, saying, He brought them out for evil, to kill them in the mountains, and to destroy them from off the face of the earth? Turn from your fierce anger, and repent from this evil against your people. 13 Remember Abraham, Isaac and Israel your servants, to whom you have sworn by yourself, and you have said to them: I will multiply your offspring as the stars of heaven; and I will give to your descendants all this land of which I have spoken, and they shall inherit it forever."),
        "armor2TextBible6": MessageLookupByLibrary.simpleMessage("Exodus 32."),
        "armor2TextLife1": MessageLookupByLibrary.simpleMessage(
            "For each circumstance of judgment, the direction must be sought, the Lord\'s justice actively and if you are not called to exercise God\'s sentence, wait on Him and continue praying."),
        "armor2TextPractice1": MessageLookupByLibrary.simpleMessage(
            "If someone sues you for any reason without reason, God\'s justice will protect you according to his purpose if you have acted righteously, an example is the case of brother Watchman Nee, who at some point in his life was accused of living with a woman without being married Indeed this was true, but when another brother inquired about the matter, this woman was his mother. He did not act in his defense, he waited and the Lord exhibited his justice. "),
        "armor2Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:14b"),
        "armor2Verse": MessageLookupByLibrary.simpleMessage(
            "“and clothed in the breastplate of righteousness,”"),
        "armor3": MessageLookupByLibrary.simpleMessage(
            "Feet Fitted with the Readiness that comes from the Gospel of Peace"),
        "armor3Text1": MessageLookupByLibrary.simpleMessage(
            "This piece of God\'s armor requires us to remember what the feet are for. As we well know, the feet are for walking, running, jumping, jogging, etc., but its main function is related to the word walking, and walking speaks of our living, so we ask ourselves, how are we living? Do we walk in the Gospel? which is a metaphor for living in the Word of God or are we walking in our own wisdom? If so we are barefoot, it is important that we know that the core of the gospel is the death and resurrection of Christ, as 1 Corinthians says: 15: 3-6 "),
        "armor3Text10": MessageLookupByLibrary.simpleMessage(
            "As you read God\'s Word and share it with those around you, peace will be a fruit of your sphere of influence. Now, it should be clarified that it does not mean that where we proclaim the Gospel will be in peace, since, the Lord himself tells us, when they go to a place full of unbelievers they will not have peace, they will have war according to what our Lord predicted. Lord Jesus Christ when he said that he would not come to bring peace, but a sword, "),
        "armor3Text11": MessageLookupByLibrary.simpleMessage(
            "Matthew 10:34-36\n34 Do not think that I have come to bring peace on earth; I have not come to bring peace, but a sword. 35 For I have come to set a man against his father, a daughter against her mother, and a daughter-in-law against her mother-in-law; 36 and the enemies of man will be those of his house."),
        "armor3Text12":
            MessageLookupByLibrary.simpleMessage("Matthew 10:34-36. "),
        "armor3Text13": MessageLookupByLibrary.simpleMessage(
            "You will have to fight the spiritual battle first and the fruit of it will be peace. As it is written in Isaiah 32:17, "),
        "armor3Text14": MessageLookupByLibrary.simpleMessage(
            "“The fruit of that justice will be peace; its effect will be stillness and confidence forever.”"),
        "armor3Text2": MessageLookupByLibrary.simpleMessage(
            "“3 For first of all I have taught you what I also received: That Christ died for our sins, according to the Scriptures; 4 and that he was buried, and that he rose again the third day, according to the Scriptures; 5 and that he appeared to Cephas, and afterwards to the twelve. 6 Later he appeared to more than five hundred brothers at the same time, many of whom are still alive, and others who are already asleep.” "),
        "armor3Text3": MessageLookupByLibrary.simpleMessage(
            "Because walking expresses an action in progression, an action that is not occasional, it is something we do all our lives, if we relate this to the Word of God as we have already said, we can infer that we must dwell in it; in order to have a deposit with the help of the Spirit and live according to the scriptures, that is, to have a vessel full of oil, and this walk speaks to those around us because it is not about our gospel, it is to live according to the message of God we proclaim, since, as believers we are commissioned to speak the gospel, Matthew 28: 19-20 "),
        "armor3Text4": MessageLookupByLibrary.simpleMessage(
            "“19 Go ye therefore, and teach all nations, baptizing them in the name of the Father, and of the Son, and of the Holy Spirit; 20 teaching them to observe all the things that I have commanded you; and behold, I am with you always, until the end of the world. Amen.” "),
        "armor3Text5":
            MessageLookupByLibrary.simpleMessage("Isaiah: 52:7 tells us: "),
        "armor3Text6": MessageLookupByLibrary.simpleMessage(
            "How beautiful are on the mountains the feet of the one who brings joyful news, the one who announces peace, the one who brings good news, the one who publishes salvation, the one who says to Zion: Your God reigns! "),
        "armor3Text7": MessageLookupByLibrary.simpleMessage(
            "We must not deprive ourselves of this beauty.\n\n"),
        "armor3Text8": MessageLookupByLibrary.simpleMessage(
            "But where is the peace in this equation? Well the Gospel is peace, because Christ is peace, John 16:33 says: "),
        "armor3Text9": MessageLookupByLibrary.simpleMessage(
            "I have told you these things so that in me you may find peace. In this world you will face afflictions, but take heart! I have overcome the world. "),
        "armor3TextBible1": MessageLookupByLibrary.simpleMessage(
            "The apostle Paul who was previously Saul, a scholar, did not use his wisdom in his preaching, he preached only Christ, as expressed in 1 Corinthians 2:1-5 "),
        "armor3TextBible2": MessageLookupByLibrary.simpleMessage(
            "“So, brothers, when I came to you to announce the testimony of God, I did not go with excellence of words or wisdom. 2 For I determined not to know anything among you except Jesus Christ, and him crucified. 3 And I was among you with weakness, and much fear and trembling; 4 and neither my speech nor my preaching was with persuasive words of human wisdom, but with demonstration of the Spirit and of power, 5 so that your faith should not be founded on the wisdom of men, but on the power of God”. "),
        "armor3TextBible3": MessageLookupByLibrary.simpleMessage(
            "Another example can be observed with Jesus who was walking with his disciples in a discipleship of three and a half years. "),
        "armor3TextLife1": MessageLookupByLibrary.simpleMessage(
            "To use this piece of the armor of God, we must read the Word of God every day in a continuous and progressive way, sharing it with the people around us with the objective that they see the gospel of Christ and peace floods their hearts. Let our life speak and when we have the opportunity we preach Christ, let us think that when an unbeliever dies he opens his eyes in hell where there will be no peace."),
        "armor3TextPractice1": MessageLookupByLibrary.simpleMessage(
            "When the Lord allows a person to share the gospel and believe, it is very important that there is a continuous discipleship so that this new believer begins the foundations for a firm walk in the Lord. The life of an athlete points to winning the gold medal, so our lives as believers must point to Christ."),
        "armor3Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:15"),
        "armor3Verse": MessageLookupByLibrary.simpleMessage(
            "“And shod your feet with the preparation of the gospel of peace.”"),
        "armor4": MessageLookupByLibrary.simpleMessage("The Shield of Faith"),
        "armor4Text1": MessageLookupByLibrary.simpleMessage(
            "The shield is a defensive weapon, like all the pieces of armor it is essential in battle, this piece has the particularity of being active, because it is not fixed, so you must be aware of where the attack or attacks come from to use it effectively, these attacks can come from any front, internal "),
        "armor4Text10": MessageLookupByLibrary.simpleMessage("evil one "),
        "armor4Text11": MessageLookupByLibrary.simpleMessage(
            "Job 1:9-12\n9 Satan answered the LORD and said, Does Job fear God for nothing? 10 Have you not fenced around him and his house and all that he has? To the work of his hands you have given blessing; therefore, their goods have increased on the earth. 11 But now stretch out your hand and touch everything he has, and you will see if he does not blaspheme against you in your very presence. 12 The Lord said to Satan: Behold, all that he has is in your hand; just don\'t put your hand on it. And Satan went out from before the LORD."),
        "armor4Text12": MessageLookupByLibrary.simpleMessage("Job 1:9-12, "),
        "armor4Text13": MessageLookupByLibrary.simpleMessage(
            "for which we must protect ourselves from the fiery darts of the evil one, that is, from lies, but how? The shield is faith, this means that we must use faith to defend ourselves from the wiles of the devil in our minds, Faith in the Word of God and in the promises that He has given in His Word. The evil one will bombard your mind with lying statements hoping to hit your soul and make you believe in those lies, but let\'s remember that the attacks can come not only from the enemy, but also from ourselves, from another person, even from the closest ones or from a circumstance.\n\nFor which the Lord urges us in Ephesians 4: 23-27 23 "),
        "armor4Text14": MessageLookupByLibrary.simpleMessage(
            "and renew yourselves in the spirit of your mind, 24 and put on the new man, created according to God in righteousness and true holiness. 25 Therefore, rejecting lies, speak truth each one with his neighbor; for we are members one of another. 26 be angry, but do not sin; do not let the sun go down on your anger, 27 nor give place to the devil. "),
        "armor4Text15": MessageLookupByLibrary.simpleMessage(
            "As you can see, the verb renew is in the present continuous, and the verb to renew is to do again, that is, it is something active, so that the lies that arrive, we do not believe, giving way to the enemy, and that dart that is not quenched can set us on fire . Lies like God is not good, God\'s Grace is not enough, I can\'t forget my past, walking with Christ is not for me, and many more. However, once hit by a flaming dart, what to do? Faith is definitely needed, but the armor of God is complete and each piece is complemented, if a dart has wounded your mind, another piece is used to drain the poison and put out the fire, and that is the Sword of the Spirit. You use the Word of God to dismantle the lie that has pierced your heart. Like a surgical blade used to heal a patient, the sword of truth, which we will see later, must be used to extinguish the fire dart received."),
        "armor4Text2": MessageLookupByLibrary.simpleMessage(
            "Job 3:1-3\n3 After this Job opened his mouth and cursed his day. 2 And Job exclaimed, and said: 3 Perish the day in which I was born, and the night in which it was said: Male is conceived."),
        "armor4Text3": MessageLookupByLibrary.simpleMessage("Job 3:1-3, "),
        "armor4Text4": MessageLookupByLibrary.simpleMessage("family "),
        "armor4Text5": MessageLookupByLibrary.simpleMessage(
            "Job 2:9-10\n9 Then his wife said to him, Do you still retain your integrity? Curse God, and die. 10 And he said to her: As any of the foolish women usually speak, you have spoken. That? Shall we receive good from God, and shall we not receive evil? In all this Job did not sin with his lips."),
        "armor4Text6": MessageLookupByLibrary.simpleMessage("Job 2:9-10, "),
        "armor4Text7": MessageLookupByLibrary.simpleMessage("church "),
        "armor4Text8": MessageLookupByLibrary.simpleMessage(
            "Job 15:1-5\n15 Eliphaz the Temanite answered and said: 2 Shall the wise utter vain wisdom, And fill his belly with east wind? 3 Will he argue with useless words, And with useless reasons? 4 You also dispel fear, And undermine prayer before God. 5 Because your mouth declared your iniquity, because you have chosen the speech of the crafty."),
        "armor4Text9": MessageLookupByLibrary.simpleMessage("Job 15:1-5, "),
        "armor4TextBible1": MessageLookupByLibrary.simpleMessage(
            "In the Bible we can see a case of someone hurt by a dart and that is Saul, the first king of Israel. When the women of Israel sang the song “Saul has killed his thousands, and David his ten thousands,“ "),
        "armor4TextBible2": MessageLookupByLibrary.simpleMessage(
            "1 Samuel 18:1-30\n18 It came to pass that when he had finished speaking with Saul, Jonathan\'s soul was bound up with David\'s, and Jonathan loved him as himself. 2 And Saul took him that day, and did not let him return to his father\'s house. 3 And Jonathan and David made a covenant, because he loved him as himself. 4 And Jonathan took off the mantle that he was wearing, and gave it to David, and other clothes of his, even his sword, his bow, and his belt. 5 And David went out wherever Saul sent him, and behaved prudently. And Saul set him over men of war, and he was acceptable in the eyes of all the people, and in the eyes of Saul\'s servants. 6 It happened that when they returned, when David returned from killing the Philistine, the women of all the cities of Israel came out singing and dancing, to receive King Saul, with tambourines, with songs of joy and with musical instruments. 7 And the women who danced sang, and said, Saul smote his thousands, and David his ten thousands. 8 And Saul was very angry, and this saying displeased him, and he said: They gave David ten thousands, and thousands to me; he lacks only the kingdom. 9 And from that day Saul did not look kindly on David. 10 It happened the next day, that an evil spirit from God took Saul, and he raved in the middle of the house. David played with his hand like the other days; and Saul had the spear in his hand. 11 And Saul threw the spear, saying, I will nail David to the wall. But David evaded him twice. 12 But Saul was afraid of David, because the Lord was with him, and had departed from Saul; 13 Therefore Saul removed him from himself, and made him commander of a thousand; and he went out and came in before the people. 14 And David conducted himself prudently in all his affairs, and the Lord was with him. 15 And when Saul saw that he behaved so prudently, he was afraid of him. 16 But all Israel and Judah loved David, because he went out and came in before them."),
        "armor4TextBible3":
            MessageLookupByLibrary.simpleMessage("1 Samuel 18:1-30, "),
        "armor4TextBible4": MessageLookupByLibrary.simpleMessage(
            "the devil took this opportunity to poison his mind with the thought that David was a threat to his family and his Kingdom. In the last few chapters, we notice how the evil one manipulated Saul through that fiery dart when he went several times to kill David. Had he used the shield correctly, he would have had faith in the thought that the same God who anointed him as king would surely defend his kingdom against all threats."),
        "armor4TextLife1": MessageLookupByLibrary.simpleMessage(
            "To fight the lies that the Enemy or our nature wants us to believe, we fight only with Faith in what the Lord tells us through the scriptures."),
        "armor4TextPractice1": MessageLookupByLibrary.simpleMessage(
            "Many times we face circumstances in our lives, circumstances that we would not choose to live, and we come to think that the Lord is not in the matter, but if we have faith in what His Word says, we will believe that those circumstances will be for our good, because for the that we love God everything works for the best as he says "),
        "armor4TextPractice2": MessageLookupByLibrary.simpleMessage(
            "Romans 8:28\n28 And we know that all things work together for good to those who love God, that is, to those who are called according to his purpose."),
        "armor4TextPractice3":
            MessageLookupByLibrary.simpleMessage("Romans 8:28, "),
        "armor4TextPractice4": MessageLookupByLibrary.simpleMessage(
            "in this way we will be using the shield of faith against the lies that want to be implanted in our hearts. "),
        "armor4Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:16"),
        "armor4Verse": MessageLookupByLibrary.simpleMessage(
            "“Above all, take the shield of faith, with which you can extinguish all the fiery darts of the evil one.”"),
        "armor5": MessageLookupByLibrary.simpleMessage("Helmet of Salvation"),
        "armor5Text1": MessageLookupByLibrary.simpleMessage(
            "The helmet or helmet in the armor has the function of covering mainly the head of the soldier, the head is a fundamental part and due to its importance it must be very well protected, the helmet of salvation indicates that as believers we must take care of our mind with the certainty of salvation in Christ, since a fearful soldier is an easy target for the adversary, for which we must be clear that we have already been justified, this is declared righteous through Jesus Christ as Ephesians 2:8-9 tells us. "),
        "armor5Text2": MessageLookupByLibrary.simpleMessage(
            "“For by grace you have been saved through faith; and that not of yourselves: it is the gift of God; 9 not by works, so that no one can boast” "),
        "armor5Text3": MessageLookupByLibrary.simpleMessage(
            "Only the perfect sacrifice of Christ makes us saved and not our works, that is what makes us have a firm and strong anchor to live with total certainty. Knowing that as believers when we die we will go to paradise for having believed in the work of Christ and not to hell gives us comfort in the face of a severe test or even a life or death situation, and even if this test has been caused by your own sin, The helmet or certainty of salvation will help you to reject the thoughts that because of your sin you are no longer saved, this is very common when we fall, but let\'s remember it is not by works, it is by grace, an undeserved gift through the merits of Christ, although by Of course when we sin we have to repent, that is, turn to the Lord because we have a lawyer and as a believer we must do works, but not for salvation, if not to be holy as the Lord is Holy."),
        "armor5TextBible1": MessageLookupByLibrary.simpleMessage(
            "Esteban the first martyr of Jesus Christ, we can see it in Acts:7 when he was about to die the certainty of his salvation allowed him to say these words: "),
        "armor5TextBible2": MessageLookupByLibrary.simpleMessage(
            "And they stoned Esteban, while he called and said: “Lord Jesus, receive my spirit. 60 And kneeling down, he cried out with a loud voice: Lord, do not hold this sin against them. And having said this, he slept.”"),
        "armor5TextLife1": MessageLookupByLibrary.simpleMessage(
            "In the Christian walk, much to our regret, we are going to sin, saddening the Lord, but He knows that and that is why he left us our eternal high priest, if you fall, get up in Him with this certainty and if today you are in doubt of your salvation for a condition of sin, repent and resume fellowship with Christ, a child never loses this condition."),
        "armor5TextPractice1": MessageLookupByLibrary.simpleMessage(
            "A missionary in a foreign country with a real threat to her life, or the woman battling cancer, or the professor giving a history lesson and not knowing the moment of her death, can rest easy when they leave because that, they are certain of the destiny that they have next to Christ for having believed in the work of redemption of Jesus Christ."),
        "armor5Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:17a"),
        "armor5Verse": MessageLookupByLibrary.simpleMessage(
            "“And take the helmet of salvation”"),
        "armor6":
            MessageLookupByLibrary.simpleMessage("The Sword of the Spirit"),
        "armor6Text1": MessageLookupByLibrary.simpleMessage(
            "The sword is the weapon in the armor that is not only used for the offense but also the defense of the soldier, so when you are in battle you have to have a sword. In the order of armor, it is the last piece that the soldier takes, but once grasped he should not let go, the sword of the Spirit is very well defined in the Bible as the Word of God, with it you fight against the adversary and/or adversity, just as Christ fought satan in "),
        "armor6Text10": MessageLookupByLibrary.simpleMessage(
            "2 Corinthians 10:1-6\nI, Paul, beg you for the meekness and tenderness of Christ, while I am present I am certainly humble among you, but absent I am bold towards you; 2 I pray, therefore, that when I am present, I do not have to use that boldness with which I am willing to proceed resolutely against some who have us as if we walked according to the flesh. 3 For although we walk in the flesh, we do not fight according to the flesh; 4 because the weapons of our warfare are not carnal, but mighty in God for the destruction of strongholds, 5 knocking down arguments and all haughtiness that stands against the knowledge of God, and taking captive every thought to the obedience of Christ, 6 and being ready to punish all disobedience, when your obedience is perfect."),
        "armor6Text11":
            MessageLookupByLibrary.simpleMessage("2 Corinthians 10:1-6 "),
        "armor6Text12": MessageLookupByLibrary.simpleMessage(
            "The Word tells us that God\'s weapons are powerful to demolish fortresses, demolishing arguments that are raised against the knowledge of God, this indicates that we must not only be prepared for the attack, but if we have already been attacked, the same sword can be used to cut and divide the wound in order to heal, as written in Hebrews 4:12 "),
        "armor6Text13": MessageLookupByLibrary.simpleMessage(
            "“Because the word of God is alive and effective, and sharper than any two-edged sword; and it penetrates to the point of dividing the soul and the spirit, the joints and the marrow, and discerns the thoughts and intentions of the heart.”\n\n"),
        "armor6Text14": MessageLookupByLibrary.simpleMessage(
            "But wait, why isn\'t the sword of the Spirit called the sword of the Word of God? Is there a mystery here? If you have a keen mind, you will notice that the Bible makes a connection between these two words, they are spiritually related. But what does it mean? It means that the Word of God expresses the actions of the Holy Spirit of God, you use the Word of God to make the difference between the Holy Spirit and any other spirit. It also means that obeying the Word of God is the same as obeying the Spirit of the Lord, because the Lord Almighty will use the Word of God to communicate His divine commands, which are confirmed by the Holy Spirit. The Word of God contains all the thoughts and words of the Holy Spirit, so if you want to follow the Holy Spirit you must learn to be led by the Word of God. Use the sword of the Spirit honorably; to bring life, not death; to defeat evil, and not let darkness dominate your land."),
        "armor6Text2": MessageLookupByLibrary.simpleMessage(
            "Matthew 4:1-11\nThen Jesus was led by the Spirit into the desert, to be tempted by the devil. 2 And after he had fasted forty days and forty nights, he was hungry. 3 And the tempter came to him, and said to him: If you are the Son of God, tell these stones to become bread. 4 He answered and said: It is written: Man shall not live by bread alone, but by every word that proceeds from the mouth of God. 5 Then the devil took him to the holy city, and put him on the pinnacle of the temple, 6 and said to him: If you are the Son of God, throw yourself down; for it is written: His angels will command about you, and, In their hands they will hold you, So that you do not stumble with your foot in stone. 7 Jesus said to him, It is also written: You shall not tempt the Lord your God. 8 Again the devil took him to a very high mountain, and showed him all the kingdoms of the world and their glory, 9 and said to him: All this I will give you, if you prostrate yourself and worship me. 10 Then Jesus said to him, Go away, Satan, for it is written: You shall worship the Lord your God, and him only shall you serve. 11 The devil then left him; and, behold, angels came and ministered to him."),
        "armor6Text3": MessageLookupByLibrary.simpleMessage("Matthew 4:1-11 "),
        "armor6Text4": MessageLookupByLibrary.simpleMessage("and "),
        "armor6Text5": MessageLookupByLibrary.simpleMessage(
            "Luke 4:1-13\nJesus, full of the Holy Spirit, returned from the Jordan, and was led by the Spirit into the desert 2 for forty days, being tempted by the devil. And he did not eat anything in those days, after which he was hungry. 3 Then the devil said to him: If you are the Son of God, tell this stone to become bread. 4 Jesus, answering him, said: It is written: Man shall not live by bread alone, but by every word of God. 5 And the devil took him to a high mountain, and showed him in a moment all the kingdoms of the earth. 6 And the devil said to him: To you I will give all this power, and their glory; because it has been given to me, and to whom I want I give it. 7 If you prostrate adore me, all will be yours. 8 Responding Jesus, said to him: Get away from me, Satan, for it is written: The Lord your God you will worship, and him only you will serve. 9 And he took him to Jerusalem, and put him on the pinnacle of the temple, and said to him: If you are the Son of God, throw yourself down from here; 10 because it is written: He will command his angels about you, to keep you; 11 and, In the hands they will support you, So that you do not stumble with your foot in stone. 12 Answering Jesus, said to him: It is said: You shall not tempt the Lord your God. 13 And when the devil had ended all temptation, he withdrew from him for a while."),
        "armor6Text6": MessageLookupByLibrary.simpleMessage("Luke 4:1-13 "),
        "armor6Text7": MessageLookupByLibrary.simpleMessage(
            "using the mighty sword of the Spirit, the Word of God, we must do the same. how to use the sword of the Spirit? Just reading it out loud is not enough, it is the wisdom revealed by the Holy Spirit that you find in the content of God\'s Word that is effective for each circumstance. Since it cannot be used in any way, the exact moment of the offensive or defensive must be discerned, because even as a believer we could misuse the sword, that is, use the Word of God incorrectly. For this reason, it is necessary to ask for the wisdom that comes from God for his Word, as the Apostle James expresses it when he says: "),
        "armor6Text8": MessageLookupByLibrary.simpleMessage(
            "And if any of you lacks wisdom, ask God, who gives abundantly to all without finding fault, and it will be given to him James 1:5 "),
        "armor6Text9": MessageLookupByLibrary.simpleMessage(
            "Only then is it effective when it comes from the wisdom of God. Another aspect that we must consider is what it says "),
        "armor6TextBible1": MessageLookupByLibrary.simpleMessage(
            "An example of a man who once took the Sword and did not put it down is one of David\'s mighty men, says the text in 2 Samuel 23:9-10: "),
        "armor6TextBible2": MessageLookupByLibrary.simpleMessage(
            "“After him, Eleazar the son of Dodo, Ahohita, one of the three mighty men who were with David when they defied the Philistines who had assembled there for battle, and the men of Israel had gone away. He got up and smote the Philistines until his hand grew weary, and his hand clung to the sword. That day Jehovah gave a great victory, and the people returned after him only to gather the spoils.” "),
        "armor6TextBible3": MessageLookupByLibrary.simpleMessage(
            "Although this was something physical, it points to the spiritual reality that if we cling to the Word of God we will have the Victory that Christ already gave us. "),
        "armor6TextLife1": MessageLookupByLibrary.simpleMessage(
            "Dwell and be rooted in the word of God, as Colossians tells us: 3:16 "),
        "armor6TextLife2": MessageLookupByLibrary.simpleMessage(
            "“May the word of Christ dwell in you abundantly, teaching and exhorting one another in all wisdom, graciously singing in your hearts to the Lord with psalms and hymns and spiritual songs.” "),
        "armor6TextLife3": MessageLookupByLibrary.simpleMessage(
            "If the Word of God dwells in us we can attack any front. "),
        "armor6TextPractice1": MessageLookupByLibrary.simpleMessage(
            "If you are a believer but you do not read the Word of God, that is, you do not take the Sword of the Spirit, you will be a helpless believer."),
        "armor6Title": MessageLookupByLibrary.simpleMessage("Ephesians 6:18b"),
        "armor6Verse": MessageLookupByLibrary.simpleMessage(
            "“and the sword of the Spirit, which is the word of God.”"),
